import React from 'react';
import { Link } from 'react-router-dom';
import './buttonPurchase.css';

export default function ButtonPurchase() {
    const cleaner = () => {
        document.location = '/purchase'
    }

    return (
        <Link to="/purchase">
        <div className='button'>

                <button
                    className='button__purchase'
                    onClick={cleaner}
                    disabled>
                    Purchase
                </button>

        </div>
</Link>
    )
}
